idata.python:
rest(8)

def sequence(sound, pattern):
    for c in pattern:
        if c == '*': playNote(sound, beats = 0.25, velocity = 50)
        elif c == '!': playNote(sound, beats = 0.25, velocity = 100)
        else: rest(0.25)
    moveTo(8)

sequence(0, '!-------------!--!!---!------------')
sequence(11, '-----!-!-!-!-!-------!-!-!-!-!--') 
sequence(4, '*-***-*-*-*-*-***--***-*-*-*-*-*')
sequence(56, '------------*-----------------*-----')
